import { Router, Link } from "@reach/router";
import { LinkButton } from '../styles/Links'
import styled from 'styled-components'

var AdjustHome = styled.div`
    display: flex;
    justify-content: center;
    margin-top: 10em;
    // width: 100%;
`;

var HomeContainer = styled.div`
    margin-top: 8%;
    display: flex;
    flex-flow: column;
    // justify-content: center;
    width: 60%;

`;

var Home = () => {
    // Declare a new state variable, which we'll call "count"
    //   const [count, setCount] = useState(0);

    return (
        <AdjustHome>
            <HomeContainer>
                <LinkButton to="csv">Csv Generation</LinkButton>
                <LinkButton to="config">Config Generation</LinkButton>
            </HomeContainer>
        </AdjustHome >
    );
}

export { Home };
